import React from 'react';

const aboutContent = [
{
    key: 'what-is-ci',
    title: "What is Carbon Intensity",
    content: [

      'Carbon Intensity is a measure of how much CO2 emissions are produced per kilowatt hour of electricity consumed. The greater the number, the greater the amount of emissions.'

    ].join(' '),
  },
  {
    key: 'kinds-of-dogs',
    title: "What Does This App do",
    content: [
      'Carbon Forecast, gives you the forecast of the level of carbon emissions (Carbon Intensity) the electricity supply to you home produces.'
    ].join(' '),
  },
  {
    key: 'acquire-dog',
    title: "Here's even more stuff about About",
    content: {
      content: (
        <div>
          <p>
            Three common ways for a prospective owner to acquire a dog is from
            pet shops, private owners, or shelters.
          </p>
          <p>
            A pet shop may be the most convenient way to buy a dog. Buying a dog
            from a private owner allows you to assess the pedigree and
            upbringing of your dog before choosing to take it home. Lastly,
            finding your dog from a shelter, helps give a good home to a dog who
            may not find one so readily.
          </p>
        </div>
      ),
    },
  },
]

export default {
  aboutContent
}
